__NUXT_JSONP__("/svet/stat/alzirsko/videa", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p){return {data:[{tabsLoad:{tabWhatToSee:b,tabPrice:b,tabPeople:b,tabTrip:b,tabContact:b,tabHotel:b,tabNeighboring:7,tabVideos:e,tabArticles:e,tabWallSockets:i,tabChains:j,tabFauna:j,tabFlora:e,tabFoods:d,tabBrands:e},place:[{tld:".dz",name:"Alžírsko",area:2381741,population:43000000,slug:k,id_continent:d,information_chatgpt:"\u003Cp\u003EAlžírsko je největší zemí v Africe a desátým největším státem na světě. Nachází se na severu Afriky a hraničí s Tuniskem, Libyí, Nigerem, Mali, Mauritánií, Západní Saharou, Marokem a Středozemním mořem.\u003C\u002Fp\u003E\n\u003Cp\u003EZemě má bohatou historii, která sahá až do antiky. Alžírsko bylo dlouho součástí Osmanské říše a později francouzskou kolonií. V roce 1962 získalo nezávislost a stalo se republikou.\u003C\u002Fp\u003E\n\u003Cp\u003EAlžírsko nabízí návštěvníkům mnoho krásných a zajímavých míst, jako jsou například pouště Sahara a Tassili n'Ajjer, které jsou zařazeny na seznamu UNESCO. Kromě toho můžete navštívit také mnoho historických památek, jako jsou starobylá města, pevnosti a mešity.\u003C\u002Fp\u003E\n\u003Cp\u003EMěstem, které byste neměli vynechat, je hlavní město Alžír. Toto město nabízí návštěvníkům mnoho zajímavých památek, jako je například kasbah, bazary, mešity a muzea. Také si můžete prohlédnout krásnou pláž a přístav, kde se můžete projet na lodi a podívat se na město z vodního pohledu.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě toho Alžírsko nabízí i kulturní zážitky, jako jsou tradiční tance, hudba a gastronomie. Alžírská kuchyně je ovlivněna arabskými, berberskými a francouzskými tradicemi a nabízí mnoho zajímavých chutí.\u003C\u002Fp\u003E\n\u003Cp\u003EAlžírsko má mnoho zajímavých míst, která stojí za návštěvu a nabízí návštěvníkům možnost poznat bohatou historii a kulturu této země. Pokud máte rádi dobrodružství a exotická místa, Alžírsko je skvělou volbou pro vaši další dovolenou.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:35,date_update:a},{name:"Hlavní jídlo",value:800,date_update:a},{name:"Chleba",value:l,date_update:a},{name:"Mléko",value:50,date_update:a},{name:"Voda (500ml)",value:l,date_update:a},{name:"Espresso",value:m,date_update:a},{name:"Zmrzlina (jeden kopeček)",value:m,date_update:a},{name:"Pivo",value:200,date_update:a},{name:"Krabička cigaret",value:400,date_update:a},{name:"Bic Mac",value:f,date_update:"Není k dispozici v Alžírsku"},{name:"Coca Cola (500ml)",value:40,date_update:a}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:c},{name:"Policie",value:"17",date_update:c},{name:"Hasiči",value:"14",date_update:c},{name:"Zdravotnická záchranná služba",value:"19",date_update:c}],phone_prefix:"+213",coordinates:[{latitude:"28.0339",longitude:"1.6596"}],people_religion:[{name:"Islám",value:"99.0%"},{name:"Judaismus",value:"0.1%"},{name:"Jiné",value:"0.9%"}],people_nationality:[{name:"Arabové",value:"80.00%"},{name:"Berbeři",value:"20.00%"}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Alžírska je potřeba mít platný cestovní pas, občanský průkaz nestačí.",date_update:g},{name:"Cestovní pas",value:"Pro vstup do Alžírska je nutné mít platný cestovní pas s minimální platností 6 měsíců od data vstupu do země.",date_update:g},{name:"Vízum",value:"Pro vstup do Alžírska je většinou potřeba vízum, které je nutné si předem zařídit na ambasádě. Výjimkou jsou některé země, s nimiž Alžírsko má podepsané smlouvy o zjednodušení vízového režimu. Pro občany ČR je nutné vízum získat předem.",date_update:g},{name:"Očkování",value:"Pro vstup do Alžírska není povinné očkování, avšak doporučuje se očkování proti žluté zimnici. Dále je vhodné být očkován proti hepatitidě A a B a být chráněn proti malárii.",date_update:g},{name:"Cestovní pojištění",value:"Cestovní pojištění není vyžadováno, ale doporučuje se mít sjednané zdravotní pojištění s plnou platností v Alžírsku.",date_update:c},{name:"Bezpečnostní situace",value:"Alžírsko má vysokou úroveň bezpečnosti, ale stále se vyskytují teroristické hrozby a kriminalita. Cestovatelé by měli být obezřetní a dodržovat bezpečnostní pokyny.",date_update:c},{name:"Další informace",value:"V Alžírsku je třeba respektovat místní zvyklosti a tradice, zejména v náboženských a konzervativních oblastech. Také se doporučuje být respektující k místním zvyklostem a kulturám. Dále je důležité dodržovat předpisy a zákony, zejména v oblasti fotografování, kde je třeba mít povolení od místních úřadů. Stejně tak platí zákaz fotografování vůbec v blízkosti vojenských objektů.",date_update:c}],type_place:n,id_image_cover:h,id_image_hero:h,id_city_main:588,affiliate:[{name:"booking",value:b}],mpz:"DZ",alerts:[],zoom:[{google:4,booking:d}],ids_neighboring_countries:[{id:136},{id:145},{id:137},{id:151},{id:162},{id:223},{id:66}],organization:[],apps:[],links:[],information_author:[],seo_tags:[],language_phrases:[],wall_sockets:f,id:62,facts_place:f,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-02T11:05:26.667745+00:00",name_original:f,currency:[{code:"DZD",name:"alžírský dinár"}],setting_top:b}],imagePlace:[{id:h,name:k,source:"\u002Fworld\u002Fstates\u002F",type:n,author:"pixabay.com",created_at:"2023-05-02T18:46:02.666888+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:d,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:d,id_image_hero:d,zoom:[{google:i,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:o,date_update:o,author_create:p,author_update:p}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-02T11:45:40.694514+00:00",name_original:"Africa",setting_top:b}]}],fetch:{},mutations:[]}}("Duben 2021",true,"05-2023",5,0,null,"09-2021",217,2,1,"alzirsko",30,60,"state","2024-03-01","1")));